ESX = nil
TriggerEvent('esx:getSharedObject', function(obj) ESX = obj end)



RegisterServerEvent('w_organizacje:changegrade')
AddEventHandler('w_organizacje:changegrade', function(grade, hex)
   local _source = source

    if grade == -1 then
        MySQL.Async.execute('UPDATE users SET w_org = @w_org, w_org_grade = @w_org_grade WHERE identifier = @identifier', {
            ['@w_org']        = "unemployed",
            ['@w_org_grade']  = "0",
            ['@identifier'] = hex
        }, function(xd)
            if xd then
                msg("Pomyślnie wyrzuciłeś członka", _source)
                TriggerClientEvent('w_organizacje:restart', -1)
            end
        end)
    else
        MySQL.Async.execute('UPDATE users SET w_org_grade = @w_org_grade WHERE identifier = @identifier', {
            ['@w_org_grade']  = grade,
            ['@identifier'] = hex
        }, function(xd2)

            if xd2 then
                msg("Pomyślnie zmieniłeś rangę członka", _source)
                TriggerClientEvent('w_organizacje:restart', -1)
               -- msg("Pomyślnie zmieniłeś rangę członka", source)
            end
        end)
    end
    

end)




RegisterServerEvent('w_organizacje:zgodanadolaczenie')
AddEventHandler('w_organizacje:zgodanadolaczenie', function(pracahere)
    local _source = source
    local xPlayer = ESX.GetPlayerFromId(_source)

   MySQL.Async.execute('UPDATE users SET w_org = @w_org, w_org_grade = @w_org_grade WHERE identifier = @identifier', {
            ['@w_org']        = pracahere,
            ['@w_org_grade']  = "0",
            ['@identifier'] = xPlayer.identifier
        }, function(xd)
            if xd then
                msg("Dołączyłeś do organizacji: "..pracahere, _source)
                TriggerClientEvent('w_organizacje:restart', -1)
            end
        end)

end)

